import './App.css';
import Request from './Request';
import Header from './Header';
import {Routes, Route} from 'react-router-dom'

function App() {
  return (
    <Routes>
      <Route index elements={
        <main>
          <Header />
          <Request />
          <Request />
        </main>
      } />
      <></>
    </Routes>

  );
}

export default App;
